import React from "react";
import { Link } from "react-router-dom";
import { ReactComponent as Logo } from "../../assets/crown.svg";
import "./header.styles.scss";
const Header = () => {
  return (
    <div>
      <Link to="/">
        <Logo />
      </Link>
      <div>
        <Link to="/">Shop</Link>
        <Link>Contact</Link>
      </div>
    </div>
  );
};

export default Header;
